use books;

#
# TABLE STRUCTURE FOR: Users
#

DROP TABLE IF EXISTS `Users`;

CREATE TABLE `Users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `firstName` varchar(255) NOT NULL,
  `lastName` varchar(255) NOT NULL,
  `dob` date NOT NULL,
  `email` varchar(255) NOT NULL,
  `createdAt` timestamp NOT NULL DEFAULT current_timestamp(),
  `updatedAt` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `UQEmail` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=210 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;



#
# TABLE STRUCTURE FOR: Books
#

DROP TABLE IF EXISTS `Books`;

CREATE TABLE `Books` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(128) NOT NULL,
  `author` varchar(255) NOT NULL,
  `genre` varchar(255) NOT NULL,
  `pubDate` smallint(6) DEFAULT NULL,
  `lang` varchar(2) NOT NULL,
  `createdAt` timestamp NOT NULL DEFAULT current_timestamp(),
  `updatedAt` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `isbn` varchar(32) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `UQISBN` (`isbn`)
) ENGINE=InnoDB AUTO_INCREMENT=509 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;



#
# TABLE STRUCTURE FOR: Addresses
#

DROP TABLE IF EXISTS `Addresses`;

CREATE TABLE `Addresses` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) NOT NULL,
  `isDefault` bit(1) NOT NULL DEFAULT b'0',
  `address` varchar(255) NOT NULL,
  `address2` varchar(255) DEFAULT NULL,
  `district` varchar(128) NOT NULL,
  `city` varchar(128) NOT NULL,
  `country` varchar(128) NOT NULL,
  `postalCode` varchar(128) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `userId` (`userId`),
  CONSTRAINT `Addresses_ibfk_1` FOREIGN KEY (`userId`) REFERENCES `Users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


#
# TABLE STRUCTURE FOR: Exchanges
#

DROP TABLE IF EXISTS `Exchanges`;

CREATE TABLE `Exchanges` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bookId` int(11) NOT NULL,
  `fromUserId` int(11) NOT NULL,
  `toUserId` int(11) NOT NULL,
  `isReceived` bit(1) NOT NULL DEFAULT b'0',
  `createdAt` timestamp NOT NULL DEFAULT current_timestamp(),
  `updatedAt` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `bookId` (`bookId`),
  KEY `fromUserId` (`fromUserId`),
  KEY `toUserId` (`toUserId`),
  CONSTRAINT `Exchanges_ibfk_1` FOREIGN KEY (`bookId`) REFERENCES `Books` (`id`),
  CONSTRAINT `Exchanges_ibfk_2` FOREIGN KEY (`fromUserId`) REFERENCES `Users` (`id`),
  CONSTRAINT `Exchanges_ibfk_3` FOREIGN KEY (`toUserId`) REFERENCES `Users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10001 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;



#
# TABLE STRUCTURE FOR: Reviews
#

DROP TABLE IF EXISTS `Reviews`;

CREATE TABLE `Reviews` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bookId` int(11) NOT NULL,
  `userId` int(11) NOT NULL,
  `exchangeId` int(11) NOT NULL,
  `rating` int(11) DEFAULT NULL,
  `createdAt` timestamp NOT NULL DEFAULT current_timestamp(),
  `updatedAt` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `bookId` (`bookId`),
  KEY `userId` (`userId`),
  KEY `exchangeId` (`exchangeId`),
  CONSTRAINT `Reviews_ibfk_1` FOREIGN KEY (`bookId`) REFERENCES `Books` (`id`),
  CONSTRAINT `Reviews_ibfk_2` FOREIGN KEY (`userId`) REFERENCES `Users` (`id`),
  CONSTRAINT `Reviews_ibfk_3` FOREIGN KEY (`exchangeId`) REFERENCES `Exchanges` (`id`),
  CONSTRAINT `Reviews_chk_1` CHECK (`rating` between 0 and 5)
) ENGINE=InnoDB AUTO_INCREMENT=3001 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_unicode_ci;


